115100005.Description:
Quando Lucy tiver energia suficiente, pressione <IconMap:Icon_SpecialReady> para ativar:
Chama os Javalis Guardiões de volta e os arremessa em uma <color=#FFFFFF>Bola Reta</color>, que explodirá ao atingir inimigos ou paredes, causando muito <color=#FF5521>Dano de Fogo</color>;
A personagem fica invulnerável ao usar esta habilidade.
Quando esta habilidade atingir um inimigo, ativa uma <color=#FFFFFF>Assistência Reativa</color>;
Quando Lucy tiver energia suficiente, mantenha <IconMap:Icon_SpecialReady> pressionado para ativar:
Chama os Javalis Guardiões de volta e os arremessa em uma <color=#FFFFFF>Bola Alta</color>, que explodirá ao aterrissar, causando muito <color=#FF5521>Dano de Fogo</color>;
A personagem fica invulnerável ao usar esta habilidade.
Quando esta habilidade atingir um inimigo, ativa uma <color=#FFFFFF>Assistência Reativa</color>.
